import React, { useState, useEffect } from 'react';
import imgl from '../asset/img/cart.jpg';
import del from '../asset/img/delete.jpg';
import edit from '../asset/img/edit.jpg';

function Dasboard() {
  const [inputs, setInputs] = useState({});
  const [showData, setShowData] = useState(false);
  const [isModalOpen1, setIsModalOpen1] = useState(false); // For delete modal
  const [isModalOpen2, setIsModalOpen2] = useState(false); // For edit modal

  const handleChange = (event) => {
    const name = event.target.name;
    const value = event.target.value;
    setInputs((values) => ({ ...values, [name]: value }));
  };

  const myExpenses = [
    { title: 'Groceries', amount: 100, date: '2025-02-01', type: 'Cash' },
    { title: 'Electricity', amount: 200, date: '2025-02-02', type: 'UPI' },
    // Add more dummy data
  ];

  const deleteExpense = () => {
    // Perform delete action here
    setIsModalOpen1(false);
  };

  const editExpense = () => {
    // Perform edit action here
    setIsModalOpen2(false);
  };

  const addexpense = (event) => {
    event.preventDefault();
    console.log('Clicked', inputs);
    setShowData(true);
    // Optionally, add new expense logic here
  };

  return (
    <div className="container">
      {showData ? (
        <div className="leftcontainer">
          <p>Total Expense:1000</p>

          {/* Delete Modal */}
          {isModalOpen1 && (
            <div id="myModal" className="modal">
              <div className="modal-content">
                <p>Do you want to delete this expense?</p>
                <button onClick={deleteExpense}>Yes</button>
                <button onClick={() => setIsModalOpen1(false)}>No</button>
              </div>
            </div>
          )}

          {/* Edit Modal */}
          {isModalOpen2 && (
            <div id="myModal2" className="modal2">
              <div className="formcard">
                <div>
                  <h2 style={{ alignSelf: 'center' }}>Edit Expense</h2>
                </div>
                <form onSubmit={editExpense}>
                  <div>
                    <label>Title</label>
                    <input
                      required
                      type="text"
                      placeholder="enter your expense title"
                      value={inputs.title || ''}
                      onChange={handleChange}
                      name="title"
                    />
                  </div>
                  <div>
                    <label>Amount</label>
                    <input
                      required
                      type="number"
                      placeholder="enter your expense amount"
                      value={inputs.expense || ''}
                      onChange={handleChange}
                      name="expense"
                    />
                  </div>
                  <div>
                    <label>Type</label>
                    <select
                      value={inputs.type || ''}
                      onChange={handleChange}
                      name="type"
                      required
                    >
                      <option disabled value="">
                        please select payment type
                      </option>
                      <option value="cash">Cash</option>
                      <option value="upi">UPI</option>
                      <option value="card">Card</option>
                    </select>
                  </div>
                  <div>
                    <label>Date</label>
                    <input
                      required
                      type="date"
                      placeholder="enter date"
                      value={inputs.date || ''}
                      onChange={handleChange}
                      name="date"
                    />
                  </div>
                  <div>
                    <button>Edit Expense</button>
                  </div>
                  <div>
                    <button type="button" onClick={() => setIsModalOpen2(false)}>
                      Cancel
                    </button>
                  </div>
                </form>
              </div>
            </div>
          )}

          <div
            style={{
              backgroundColor: 'gray',
              width: '100%',
              overflowY: 'scroll',
              marginBottom: '50px',
              justifyContent: '50px',
              justifyItems: 'center',
              padding: '20px',
            }}
          >
            {myExpenses.map((expense, index) => (
              <div className="expensecard" key={index}>
                <div
                  style={{
                    width: '100%',
                    display: 'flex',
                    flexDirection: 'row',
                    justifyContent: 'flex-end',
                    justifyItems: 'center',
                    alignContent: 'center',
                    alignItems: 'center',
                  }}
                >
                  <img
                    onClick={() => setIsModalOpen2(true)}
                    style={{ width: '30px', height: '30px' }}
                    src={edit}
                    alt="Edit"
                  />
                  <img
                    onClick={() => setIsModalOpen1(true)}
                    style={{ width: '20px', height: '20px', marginLeft: '4px' }}
                    src={del}
                    alt="Delete"
                  />
                </div>
                <p>{expense.title}</p>
                <p>{expense.amount}</p>
                <p>{expense.date}</p>
                <p>{expense.type}</p>
              </div>
            ))}
          </div>
        </div>
      ) : (
        <div className="leftcontainer">
          <p>Please add your expenses</p>
          <img src={imgl} alt="Expenses" />
        </div>
      )}

      <div className="rightcontainer">
        <div className="formcard">
          <div>
            <center>
              <h2>Add Expense</h2>
            </center>
          </div>
          <form onSubmit={addexpense}>
            <div>
              <label>Title</label>
              <input
                required
                type="text"
                placeholder="enter your expense title"
                value={inputs.title || ''}
                onChange={handleChange}
                name="title"
              />
            </div>
            <div>
              <label>Amount</label>
              <input
                required
                type="number"
                placeholder="enter your expense amount"
                value={inputs.expense || ''}
                onChange={handleChange}
                name="expense"
              />
            </div>
            <div>
              <label>Type</label>
              <select
                value={inputs.type || ''}
                onChange={handleChange}
                name="type"
                required
              >
                <option disabled value="">
                  Please select payment type
                </option>
                <option value="cash">Cash</option>
                <option value="upi">UPI</option>
                <option value="card">Card</option>
              </select>
            </div>
            <div>
              <label>Date</label>
              <input
                required
                type="date"
                placeholder="enter date"
                value={inputs.date || ''}
                onChange={handleChange}
                name="date"
              />
            </div>
            <div>
              <button type="submit">Add</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Dasboard;
